import React from "react";

function Card(props){
    return(
        <>
         <div className="cards">
    
    <div className="card1">
      <img src={props.imgsrc}/>
      <span>{props.title}</span>
      <h1>{props.sname}</h1>
      <a href={props.link}>
        <button>Click Here to Watch</button>
      </a>

    </div>

  </div>
        </>
    )
}

export default Card;
